INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (1, '<p class="titulo">DICCIONARIO</p>', 1);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (1, '<p>bibliographico alphabetico, e índice/ Sylabo Repertorial de quantos libros sencillos existen en esta/ Libreria de este convento de/ N[uestro] S[eráfico] P[adre] S[an] Francisco de Mex[i]co./ <br/>Ordenado con toda prolixidad y distinción, assí por titulos como por/ Apellidos de sus Authores, por Fray Fran[cis]co Antonio de la Rosa Figueroa/ Predicador, Notario App[ostóli]co Notario y Revisor de libros por el santo Officio/ y Bibliothecario (que fue) de este dicho convento: para que con toda/ facilidad se hallen según el orden de la letra inicial alphabetica,/ continuada por las respectivas Clases y Facultades, colocados en las/ Marcas, y Numeros, que por todas las Cameras, o Estantes distin/guen las tarxillas (a las quales remite este diccionario) indicando/ assí los números correspondientes en los Libros como en el Bezerro/ <br/>o Inventario de ellos cuyas paginas se indican. <br/>Terminado el Diccionario sigue un peregrino Apendix Bibliographico/ en que se describen todos los Catalogos, Materias, titulos, Argumentos/ o Ideas de las obras, Questiones quod libetales, opusculos, e Inscripciones/ íntegras Bibliographicas de los Authores y titulos que en el Diccionario/ quedan annotados, y reclamados con * al margen: de que resulta/ en el Apendix una curiosíssima Bibliographía con selectíssimas, y mui/ agradables noticias: A que se añade un Indice particularissimo/ en orden Alphabetico de todos los Apellidos de los Autores que han/ ilustrado con sus sermones, y singulares obras nuestras Regiones/ Americanas: Y de los sermones impresos colectados en sesenta y seis/ tomos (con título particular de Laurea evangélica Americana)/ se indican, para alivio de los Predicadores, assí los Assumptos como/ los templos donde se predicaron: pero para enterarse en este Dicci/onario y el Apendix es mui necesario se lean las Advertencias q[ue] les/ preceden, que no son molestas sino succintas y compendiosas.//</p>',2);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (2, '<p class="titulo">ADVERTENCIAS PRELIMINARES/ Y DIRECTORIAL[E]S AL DICCIONARIO</p>', 1);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (2, '<p>1. La primera y principalíssima advertencia que ha observar/ qualquiera Religioso para su proprio util y el de todos los/ demas de este convento que se aprovecharen de este Dicci/onario es tener cuidado de la marca y estante de donde saca/ el Libro Y Luego que le sirva res[ti]tuirlo a ella y a su numero/ sin confundirlo con otras marcas puesto que todas están pa/tentemente diferenciadas en los tamaños Y si de esto no se/ tiene cuidado, especialmente el P[adre] Bibliothecario de nada ser/vira este diccionario que tan sumo trabajo me ha costado/ <br/>2. La 2a. advertencia es no quitar o despegar los pape/lillos en que están los numeros de los Libros y la letra de/ la facultad a que corresponden pues en faltando al/ Libro de qualquiera marca su letra y numero Ya no se/ hallaran por el Diccionario ni se sabra si es sencillo o si/ Duplicado/ <br/>3. Advertencia 3. mui necesaria es reflexionar por todo el/ Diccionario en las remissiones que hago siempre hora en los/ titulos de las obras (que es con mas frecuencia) hora en los/ nombres de muchos Autores a sus Apellidos precediendo siem/pre al Apellido una V. que quiere dezir vease o vide pongo/ exemplos Gregorius de Valencia. V. Valencia esto es que se/ busque en su letra inicial de Apellidos el Apellido Valencia/ Alexandri de Ales V. Hales esto es busquese el Apellido en/ la Letra H no en la letra A. Controversiae fidei. V. Bellarminum/ esto es busquese el Apellido Bellarmino sub Littera B./ Dueñas Singularia theologiae Moralis V. Quintana Dueñas esto es/ busquese el Apellido Quintana en la letra Q./ <br/>4. Advert[enci]a 4. Para hallar los Apellidos en sus respectivas/ letras iniciales donde remito desde las respectivas letras de/ los titulos no es necesario fatigarse en recorrer toda la letra/ inicial de aquel Apellido sino reflexionar que la remision que/ en la letra del título hago a la letra del Apellido es respectiva/ seorcim a la misma numero clase y marca del mismo título// </p>',2);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (3, '<p class="titulo">Advertencias preliminares al Diccionario</p>', 1);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (3, '<p>Pongo exemplo. el título Controversiae fidei en la letra C de los/ Dogmaticos me remite en el Apellido Belarmino a la letra B./ no me fatigare en recorrer el diccionario de toda letra B. sino/ que me ire derecho a la letra B de los Dogmaticos y en el orden/ de su Marca y numero hallare Bellarmini Roberti Cardinalis, Con/trovertiae fidei. A este exemplo guarda este diccionario esta corres/pondencia de clases y facultades en qualesquiera remissiones aunq[ue]/ los titulos se indiquen en una letra inicial y los apellidos en otra/ y el mismo método pariformiter se establece en varias remisiones/ que se encontraran en la letra inicial o de un título a otro título/ o de un apellido a un título o de un Apellido menos conocido/ a otro mas comun Y en todas estas estas remissiones es regla general/ q[ue] nunca sale allí el Libro numerado al margen sino q[ue] mediante la/ letra V. o la palabra Vide me remito a la letra inicial hora del/ apellido (que es lo mas frequente) hora del título donde indefecti/blemente se hallaran en las correspondencias de las mismas clases/ numerados los Libros e indicadas las marcas que en las remisiones/ no se indican ni numeran. Methodo repertorial fidelissimo que/ me ha costado al ingentissimo trabajo y desvelo q[ue] solo Dios sabe/ pues para q[ue] correspondan en orden alphabetico por una parte los/ titulos y por otra los Apellidos ha sido necessario si bien se con/sidera trasumptar dos vezes el inventario reduciendolo a un/ continuado Sylabo Diccionario Y aun triplicar en esta reducción/ a caso la mayor parte del Inventario o por llamar los segundos/ apellidos o por indicar muchos nombres o por declarar mas los/ titulos por otras letras iniciales porq[ue] no quede libro ni titulo ni/ apellido que se ignore/ <br/>5. Advert[enci]a 5. utilissima. En la clase de los expositivos les ministro/ un grande alivio a mis Padres y hermanos que buscaren o desea/ren hallar muchas exposiciones sobre un mismo Libro o texto/ del Viejo o del nuevo testamento por que todos los Libros de la Di/vina escriptura los distribuyo por la letra inicial de sus titulos/ Ordine alphabetico en el Diccionario formado como un apendix a/ cada respectiva letra diccionaria de la classe de los expositivos Y en/ cada libro o titulo de libro de la Sag[rad]a escriptura hago las remisiones/ a todos los Apellidos de los expositores que en mi diccionario consta/ que expusieron seorcim pro dignitate tal o tal Libro de la Biblia // </p>',2);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (4, '<p class="titulo">Advertencias preliminares al Diccionario</p>', 1);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (4, '<p>Y en la letra V del Diccionario de expositivos sub titulo Universae Scripturae/ expositores hago remission a los Apellidos de los que la expusieron toda/ Y porque Yo se Yo se que esta mi invectiva será a todos mui util y mui/ agradable la prevengo con el indice siguiente de todos los Libros de la/ Sagrada Biblia indicandolos aqui primero Simul ordine Alphabetico Y des/pues destribuyendo seorcim cada letra en el diccionario. Y porque aquí/ lo debo ordenar mas por nombres de Patriarchas Prophetas Apostoles Y/ evangelistas que por titulos advierto q[ue] en mi Diccionario en el Apendix/ breve de la letra E de expositivos sub titulis evangelia epistolae expresase/ los nombres de evangelistas Y Apostoles. el Indice es el Siguiente./ </p>',2);
