S. Marci evangelium</p></div> <div class="celda"><p class="titulo">N</p> <p>Numerorum Liber</p> <p>Nahum Prophetia</p> <p>Nehemias v. esdrae libri</p></div> <div class="celda"><p class="titulo">P</p> <p>Paralipomenon Libri</p> <p>Psalmorum Liber</p> <p>Proverbia Salomonis</p> <p>S. Pauli epistola ad.</p> <p>Rom. Corinth. Qalat.</p> <p>ephes. Philip. Colossens.</p> <p>thesal. timothy. titum.</p> <p>Philemon. Hebraeos</p> <p>S. Petri epistolae canonic.//</p> <p>Advertencias preliminares al Diccionario</p></div></div>',2);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (5, '<div class="tabla"><div class="celda"><p class="titulo">R</p> <p>Regum Libri</p> <p>Ruth Liber</p> <p>Romanos epist. v. Paul</p></div> <div class="celda"><p class="titulo">S</p> <p>Sophoniae Prophetiae</p> <p>Sapientiae Liber</p></div> <div class="celda"><p class="titulo">T</p> <p>Tobiae Liber</p> <p>Thraeni Jeremiae</p></div> <div class="celda"><p class="titulo">Z</p> <p>Zachariae Prophetiae</p></div></div>',2);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (5, '<p>Por todas las Letras Iniciales de estos titulos o Libros de la Sagrada/ Biblia corresponderan en el Diccionario de expositivos las remisiones/ a los Apellidos de los Autores q[ue] ay en la Librería. Y ya que forme este/ Indice Biblico no es fuera de proposito el prevenir aqui a los aficio/nados al Methodo de tener presente la Coordinacion de los Libros/ Capitulos y pasages de la Biblia se apliquen a leer la Arte Bi/blica q[ue] solo para este fin tan util como provechoso Ilustrose, añadiose/ y corrigio N[uestro] R[everendo] P[adre] fr[ay] Martin del Castillo cuya inscripcion se hallara/ en mi Apendix al Apellido Castillo sub Litt. C de los expositivos/ <br/>6. A los Padres Predicadores les franquea mi diccionario mu/cha materia en las inscripciones de los titulos de los Libros Pre/dicables Latinos y Castellanos Y con tal curiosidad como lo pue/den reflexionar en las Letras C. E. M. P. S. Verb. Concepcion,/ Eucharistia- Mariales- Passion, Sacramento, Sufragios y otros/ vocablos de Assumptos empeñosos para los quales hago re/missiones a los apellidos de Autores q[ue] predicaron Y escri/vieron sobre estas Y otras muchas materias predicables/ <br/>7. A los inclinados a la erudicion les franquea assí mi Dic/cionario como mi apendix sino quanto pueden desear a lo menos quan/tas noticias puede aver hasta oy en la Librería/ <br/>8. A los addictos a la Historia o Sagrada o Prophana o natural/ Les Lisongea el Diccionario y el Apendix el Gusto porq[ue] en las pala/bras chronica, Historia, Vidas, Apologias, Miscelanea, de los Diccio/narios historicos tienen en q[ue] escoger al gusto y al provecho/ </br>9. A los estudiosos del Derecho canonico Civil o Regular les minis/tro por todas las dicciones respectivas a estas facultades todo quanto/ se puede abreviar en la bibliographia de los Libros que existen y sobre/ todo lo q[ue] corona las noticas Bibliographicas de esta facultad Y en/ q[ue] puse sumo esmero es en el enchiridion assi repertorial utrius q[ue]/ juris como directorial para leerlo citarlo y referirlo Y estoy cierto que/ se me perdonara lo que en este opusculo me difundi por la utilidad q[ue]/ del podran sacar mis hermanos//</p>',2);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (6, '<p class="titulo">Advertencias preliminares al Diccionario</p>', 1);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (6, '<p>10. Por mayor conveniencia para el registro Y uso facil de todo este/ volumen y q[ue] sin confusión alguna se distinga todo en sus propios lugar[e]s orbitre/ q[ue] a continuacion del presente Diccionario general demostrado exteriormente/ en los presentes registros (que llaman digitales) correspondiese en el or/den mismo de registros el Apendix Bibliographico para q[ue] llamada la/ atencion por cada estrellita en el Diccionario se ocurra con promptitud/ Y facilidad al Apendix en la letra respectiva al titulo o al Apellido que/ la * reclama Y digo al titulo o al Apellido por q[ue] lo mas frequente es/ reclamar las estrellitas a los titulos, pero se hizo necesario en muchas/ partes reclamar a los Apellidos Y no a los titulos por lo qual quan/do el reclamo de la estrellita no corresponda por la letra del titu/lo con la respectiva del Apendix correspondera indefectiblemente/ por la letra del Apellido./ <br/>11. El Diccionario tercero de Apellido correspondiente al parti/cularissimo Juego de la Laurea evangelica Americana concionatoria/ no tiene dependencia ni con el Diccionario general q[ue] se sigue ni con/ el Apendix en lo que dize descripcion Bibliographica por que la de la/ d[ic]ha Laurea por ser singularissima y q[ue] no se hallara exemplar de ella/ en Libreria alguna de Nueva españa ni de la europea en el Me/thodo de su coordinacion forma clase aparte su Diccionario en/ este Libro en q[ue] para no confundir tres ordenes de Alphabetos or/bitre distinguir el de la Laurea al methodo alphabetico de los/ Libros q[ue] llaman de Caxa por lo qual si en el Diccionario General/ se apuntan algunos Apellidos o titulos correspondientes a la d[ic]ha Laurea/ solo es nuncupativa y siempre remitiendome a este especifico Ju/ego diziendo vease Laurea Americana o para q[ue] se ocurra a su/ Diccionario de Apellidos o para q[ue] en el Diccionario general al titulo/ Laurea evangelica sub Littera L se advierta en Synopsis su coordinac[io]n/ <br>12. El Diccionario 4 q[ue] pongo a continuacion del tercero solo/ es un enchiridion breve en q[ue] repitiendo Apellidos contenidos/ en el Diccionario g[ene]ral quise especificar en credito del Criollismo/ un Synopsis Bibliographico de las obras y opusculos que nuestros conRe/gionales dieron a Luz indicando en compendio los que existen en esta/ Libreria hasta oy el qual Diccionario como lo pongo Y el anterior de la/ Laurea acresento mucho a n[uest]ro Amantissimo e ill[ustrísi]mo Paysano el S[eño]r D[octo]r/ D[on] Juan Joseph de Eguiara la exclarescida obra de su Bibliotheca Ame/ricana Y para que en el Diccionario g[ene]ral aya signo q[ue] distinga las/ obras de n[uest]ros conRegionales annoto a los margenes o los titulos o los Apel/lidos con este signo  ƒ¶ que reclama al d[ic]ho enchiridion.//</p>',2);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (7, '<p class="titulo">Advertencias preliminares al Diccionario</p>', 1);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (7, '<p class="titulo">Y especificas a los Padres Bibliothecarios</p>', 1);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (7, '<p>Aviendome dedicado al año de 1748 a la ardua empresa (en q[ue] expendi un/ año de costosos desvelos) de formar el alivio y utiles noticias de mis her/manos un exquisito especifico Diccionario Alphabetico para el registro o Reper/torio de los Libros de esta Libreria y vencido mi teson esta dificultad/ en diez y siete Alphabetos que forme, correspondientes a otras tantas classes/ de Libros q[ue] en 17 Letras se distinguen en toda la Librería por el orden de/ su colocacion bajo las tarjas superiores de los estantes q[ue] hize rotular/ segun mi pensamiento Y como en el decurso de nueve años se fuesen aug/mentando en gran manera los Libros se suerte q[ue] en el presente de 1758/ Ya pasan de mil y quinientos los aumentados solo sencillos sin men/sionar otros tantos duplicados concideraba mi bien empleado esmero/ Y cuidado de quanto lustre Seria para esta Librería si aviendome de/ costar nuevo trabajo de añadir reformas Y mejoras el diccionario q[ue]/ llevo d[ic]ho llegase a tener efecto en mejor idea este volumen que si pue/de llamarse obra peregrina por lo singular lo remito a la sentencia de/ los desapasionados q[ue] la investigaren y examinaren en Justicia. A mi me/ parece q[ue] ofresco a mis Padres y hermanos en este tal qual Opusculo/ no solo una singular Bibliotheca especifica para esta Librería sino/ una Lengua Bibliographica de ella en q[ue] he empeñado todo, mi/ esmero por sacarla en el orden y distincion que por sus inscrip/ciones esta patente y por las pretiminares advertencias a sus tratados/ con la singularidad (entre las muchas que se dexan ver) de que los q[ue]/ en mi primera planta forme en diez y siete Alphabetos se reduce/ a uno solo en el Diccionario general y a su correspondencia en el Apen/dix Y porque de la conservacion y buen trato en el uso de este preci/oso volumen (que sera mui dificil trasladar) pende assi la singular/ Bibliographia de esta Libreria como la utilidad Y alivio de mis ama/dos Padres y hermanos a quienes emprendi dexar esta prenda y me/moria de mi buen deseo de servirles no puedo escusar el prevenir a/ los Padres Bibliothecarios que me sucedieren algunas breves advertencias./ <br/>La primera y principalissima es que este volumen dudo q[ue]/ dure un año si se queda de asiento en la Librería expuesto al des/aliñado traqueo de muchos que no cuidan del buen trato aun de los/ Libros de su uso. Y que aunq[ue] se huviera de salvar este inconveniente/ Y que todos igualmente lo manejaran con limpieza Y sin dexarselo so/bre las mesas abierto como hazen muchos con los Libros es consi/guiente al manejo succesivo de muchas manos la notable ruina de/ este Libro por lo qual si en las Librerias de Rumbo no solo las pri/meras de las Religiones Y colegios de la Nueva españa Y de la Europa//</p>',2);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (8, '<p class="titulo">Advertenc[ia]s previas al Diccion[ari]o y especificas a los Padres Bibliothecar[io]s</p>', 1);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (8, '<p>sino aun la del escurial del Rey y la Vaticana de Roma donde ocurren/ muchos individuos a registrar los Libros solo para los Diccionarios en/ las manos de los Bibliothecarios para poner en las de los estudiantes los/ Libros que necesitan Y volberlos a su lugar. no se yo que razon podra/ aver para q[ue] no aviendo mas libro q[ue] este para la comun utilida y pro/vecho de todos Y singular lustre de una Libreria tan de rumbo como lo/ es esta a voz de todo Mex[i]co se aya de acabar esta Bibliographia en mui/ pocos dias con el succesivo traqueo entre muchas manos quando con/ ocurrir al P[adre] Bibliothecario que siempre está prompto por su officio sabra/ satisfacer el estudio desempeño curiosidad o recreacion honesta de/ quantos necesitaren de los Libros con solo requerir al Bibliothecario acerca/ del titulo o Autor que buscan que como exista en la Librería lo pon/dra luego en las manos y ministrara principalmente en los que recla/man al Apendix o pertenecen al Juego de la Laurea Americana qu/antas noticias curiosas y exquisitas quedan apuntadas. Yo se que esto/ ha de tener de costo algunos disgustos Y contradiciones pero si la dis/crecion y prudencia del pobre Bibliothecario no pudiere escusar los tam/bien se que puestos n[uest]ros R[everendos] P[adres] Pro[vinci]ales en el conocimiento de esta/ tan importante Bibliotheca y Bibliographia sabran auxiliar a su conservac[io]n/ <br/>Para que los Libros puedan hallarse luego por este Diccionario en/ las facultades marcas y numeros correspondientes es essencialmente/ necesario q[ue] el P[adre] Bibliothecario ponga sumo cuidado en recorrer con la/ vista las Lineas o Cameras de los estantes para ver si les han despe/gado o quitado a los Libros los papelillos distintivos de las clases y numeros Y si esto sucediere (como ordinariamente lo he experimentado/ en onze años sin q[ue] me aya valido pegarlos con cola) se ha de procurar/ luego remediar pegando otros papelillos de nuevo con su letra y num[er]o/ correspondiente Y si por averse arrancado y perdido los papelitos/ se ignora totalmente donde esten algunos Libros por averlos entre/metido los Padres o en otras marcas o en distintas clases o entre los/ duplicados como muchos lo hazen (aun sin faltar el papelito) sera/ necesario a expensas de la paciencia recorrer la Libreria para des/cubrir los q[ue] no sera dificil pues luego avisara la falta del papelito Y/ si hallados los Libros sin papelitos se duda a que letra numero y mar/ca pertenecian es mui facil reducirlo o por el Apellido del Autor o por/ el titulo de la facultad que indicare ocurriendo a el Diccionario/ donde luego se hallara la marca y numero a que corresponde la/ letra q[ue] se le ha de poner al papelillo Y hasta el lugar correpondi/ente en la pagina y numero del inventario pues este fue uno de/ los fines que tuve en todo el Diccionario general de llamar las/ coordinaciones de las Marcas y numeros por las paginas del/ Inventario// </p>',2);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (9, '<p>Debo advertir q[ue] para pegar los papelitos de ninguna manera sirve/ ni el atole ni el agua cola ni la cola mui espesa. Lo mejor es el/ engrudo Y si es de almidon es mucho mejor q[ue] el de harina no escuso la/ prolixidad de apuntar el modo en q[ue] se haze segun el arte de las encu/adernadores porque de ellos lo he aprendido en la encuadernacion de la/ Libreria. La quarta parte de tlaco de almidon se bate en dos posuelitos de agua en un xarrito o ollita q[ue] no sirva de manteca y sacado el mo/linillo se pone al fuego manso Y se esta meneando con una paletita/ sin dexarlo pegar y el mismo va espesando Y tanto ha de espesar y/ consumir q[ue] llegue a punto de Masa Xala y con la cantidad que resul/ta ay engrudo para mas de 200 papelitos estos se embarran mui/ bien cada uno de por si con un dedo cuidando que queden las/ orillas bien engrudadas para q[ue] d[ic]hos papelillos queden bien pegados/ Las plantas que orbitre de Linear en Junto los quadritos por tama/nnos proporcionados a las marcas las pongo al fin de este Libro/ con las advertencias q[ue] a ellos conducen Y no censuraran mi nimie/dad Y materialidad los Padres Bibliothecarios en haziendoles re/flexionar la propia experiencia q[ue] de estas nimiedades pende el/ conservarse con limpieza y seguridad en los Libros las Letras y los/ numeros correspondientes a sus classes y marcas para que ni se/ confunda ni se pierda la correspondencia fidelissima de los/ titulos y apellidos con este Diccionario/ <br/>Todos los blancos q[ue] en el Diccionario he ido dexando gene/ralmente de marca a marca por cada clase en el orden de cada/ letra inicial de apellidos y titulos lo he hecho ex intentu por prevenir/ proporcionados blancos para q[ue] conforme se fueren aumentando/ en el inventario los Libros en sus Clases se continuen en el Diccio/nario bajo de las mismas clases marcas y numeros respectivos/ las nuncupaciones de titulos o Apellidos: Y en las Letras escazas/ de iniciarlos no por esto omito esta prevencion por si cayeren a lo/ menos algunos apellidos q[ue] aya lugar donde apuntarlos/<br/>Con la misma prevencion procedi en el Apendix, y en el por/ no abultar demasiadamente el volumen no quise añadir muchas/ foxas ni planas blancas para descripciones Bibliographicas lo uno/ porq[ue] se que el Diccionario llama mui bien la atencion en las nuncupa/ciones de los titulos q[ue] no ay necesidad de describir en el Apendix/ lo otro porq[ue] las Letras iniciales K. X. Y. Z. q[ue] en el Apendix omita son/ infecundas de iniciar titulos Y escazas en iniciar apellidos. Y con/ Las foxas Y planas blancas que quedan en las clases o facultades/ que mas abundan en iniciar titulos peregrinos me parecio q[ue] basta//</p>',2);
INSERT INTO texto (folio_id, contenido, tipo_id) VALUES (10, '<p>En  el Diccionario de Apellidos de la Laurea evangelica dexo los/ competentes blancos para q[ue] si los Padres Bibliothecarios aumentaren en/ numero la coordinacion del Juego peregrino (q[ue] ha causado mucha admiracion y complacencia a innumerables sugetos de toda distinc[io]n/ ecclasiasticos y Seculares Y Religiosos de todas Religiones q[ue] lo han visto)/ aya lugar de continuar los apuntes en el methodo q[ue] alli consta./ <br/>Por la misma razon dexo tambien competentes blancos al/ enchiridion Alphabetico de los Authores Americanos cuyas obras existen/ en esta libreria para q[ue] los Padres Bibliothecarioa lo continuen o añadi/endo los q[ue] a mi se me huvieren pasado por olvido o inadvertencia/ o aumentando los q[ue] nuevamente ocurrieren/ <br/>Omito qualesquiera advertencias y prevenciones en orden/ a libros y manejo encuadernacion Y coordinacion de ellos porq[ue]/ en todos los Inventarios formados de mi letra quedan bien pa/tentes quantas me han parecido necesarias especialmente las/ q[ue]  constan en los inventarios de los años de 1752. 1757. 1758. y porq[ue]/ las presentes solo las dirijo a la conservacion manejo e inteli/gencia de esta singular Bibliographia en q[ue]  no me ha movido/ otro fin en fatigar mi cabeza y Salud en la abansada edad/ de Sesenta y Un años que el de dexar a mis amados her/manos algunas Luces para sus alivios y Lucimientos en sus/ empeños Literarios impartiendo a unos las peregrinas noti/cias que ignoraren y a los Doctos Y eruditos solo despertando/ las que dormitaren: Por q[ue] ha hecho eco en mi buen afecto con que/ he estudiado para tal qual noticia (no para enseñanza) de/ otros: aquel sinefictione didici et sine invidia communico/ Sea todo para honra y Gloria de Dios N[uesto] S[eñor] en cuyo Nombre S[antísimo]/</p>',2);
