INSERT INTO texto (folio_id, contenido, tipo_id) VALUES(190, 'Este es un Juego mui especifico y mui prolixamente colectado con la mas exacta curiosidad assi en lustre de los Predicadores del Criollismo como en gracia de los Predicadores de este convento este Juego lo coordine en 66 tomos (hasta donde pude) su curiosa coordinacion consta en el inventario de los sencillos desde la pag[ina] 111 Y porque el titulo con que lo dispuse encuadernar fue la Laurea evang[éli]ca Americana se indican aqui los Obros tomos (aunque en compendio) debajo de este titulo reservado para lo ultimo de este Diccionario Bibliographico general el Particular de Apellido de Autores titulos Y empeños de sus Sermones a donde remito al Curioso para su alivio Y desempeños de sus Assumptos como lo reflexionara desde la pag[ina] de este libro ', 2);
